import React from 'react';
import '../App.css';

import HomeBackground from '../DesignElements/Train.png';
import PoudlardLogo from '../DesignElements/LogoPoudlard.png';
import Footer from './Footer.js';

function Home () {
    return (
      <div className="App">
        <img src={HomeBackground} className="App-logo" alt="logo" />
        <Footer/>
      </div>
    );
  }

export default Home
